  - name: TEXT4000
    number: '6'
    value: We continue to experience technical difficulties with the current version
      of the FECFile software, version 6.1.1.3. After several conversations with tech
      support they are still unable to determine what the problem is or how to fix
      it. We are receiving warning messages about our committee ID's being missing,
      although they are there. Tech support mailed us a CD version of the software,
      but we are still experiencing the same problems. When we emailed tech support
      the file they said that everything looks fine to them and they do not get the
      same error messages that we do. Hopefully all of our information is transmitting
      properly even though it doesn't show at our end. We understand that a new version
      of the software will be released in June, and hope that this newest version
      will resolve our issues.
